import React, { PureComponent} from 'react';

export default class Login extends PureComponent {
    render() {
        return(
            <div className="login">
                <h1>Login/Join</h1>
                <form>
                    <label>Login Id
                        <input type='text'/>
                    </label>
                    <label>Password
                        <input type='password'/>
                    </label>
                    <button>Login</button>
                    <p>Create a new account</p>
                    <p>Help, I forgot my password</p>
                </form>
            </div>
        )
    }
}
